import { Badge, withStyles } from "@material-ui/core";

const BadgeSelected = withStyles(theme => ({
  badge: {
    top: "100%",
    right: "90%",
    height: "32px",
    width: "32px",
    borderRadius: "50%"
  }
}))(Badge);

export default BadgeSelected;
